function setStateChangeCallback(callback) {
    if (typeof mraid !== typeof undefined) {
        var onStateChange = function() {
            callback(mraid.getState() !== "hidden")
        }
        mraid.addEventListener("stateChange", onStateChange);
    } else {
        console.error('mraid is undefined');
    }
}

function startGame(startGame) {
    if(typeof mraid !== typeof undefined) {
        if (mraid.getState() === "loading") {
            var onReadyCallback = function() {
                mraid.removeEventListener("ready", onReadyCallback);
                startGame();
            }
            mraid.addEventListener("ready", onReadyCallback);
        }
        else {
            startGame();
        }
    } else {
        console.error('mraid is undefined');
        startGame();
    }
}

function openStore(storeLink) {
    if(typeof mraid !== typeof undefined) {
        mraid.open(storeLink);
    } else {
        console.error('mraid is undefined');
    }

0.00001)\n        H = (2.0 + (color.b - color.r)/C);\n    else if (absolute(V - color.b) < 0.00001)\n        H = (4.0 + (color.r - color.g)/C);\n\n    H = mod(H, 6.0);\n\n    if (L <= 0.0)\n        L = 0.00001;\n    \n    if (L >= 1.0)\n        L = 0.99999;\n\n    float S = (V - L)/min(L, 1.0 - L);\n\n    color.r = H;\n    color.g = S;\n    color.b = L;\n\n    return color;\n}\n\nvec4 hslToRGB(vec4 color) {\n    float H = color.r;\n    float S = color.g;\n    float L = color.b;\n\n    float C = (1.0 - absolute(2.0 * L - 1.0)) * S;\n    float X = C * (1.0 - absolute(mod(H, 2.0) - 1.0));\n\n    float r, g, b;\n    if (H <= 1.0) { r = C;   g = X;   b = 0.0; } else\n    if (H <= 2.0) { r = X;   g = C;   b = 0.0; } else\n    if (H <= 3.0) { r = 0.0; g = C;   b = X;   } else\n    if (H <= 4.0) { r = 0.0; g = X;   b = C;   } else\n    if (H <= 5.0) { r = X;   g = 0.0; b = C;   } else\n    if (H <= 6.0) { r = C;   g = 0.0; b = X;   }\n\n    float m = L - C/2.0;\n    \n    color.r = r + m;\n    color.g = g + m;\n    color.b = b + m;\n\n    return color;\n}\n\nvec4 applyHSLShift(vec4 color, float weight) {\n    color = rgbToHSL(color);\n\n    float H = color.r; // in range [0.0, 6.0]\n    float S = color.g;\n    float L = color.b;\n\n    H += u_hueShift;\n    H = mod(H, 6.0);\n\n    S *= u_saturation;\n    L *= u_luminosity;\n\n    color.r = H * weight + (1.0 - weight) * color.r;\n    color.g = S * weight + (1.0 - weight) * color.g;\n    color.b = L * weight + (1.0 - weight) * color.b;\n\n    return hslToRGB(color);\n}\n\nfloat brightnessAndContrast(float color) {\n    return (color - 0.5) * u_contrast + 0.5 + u_brightness;\n}\n\nvec4 applyBrightnessAndContrast(vec4 color, float weight) {\n    color.r = brightnessAndContrast(color.r) * weight + (1.0 - weight) * color.r;\n    color.g = brightnessAndContrast(color.g) * weight + (1.0 - weight) * color.g;\n    color.b = brightnessAndContrast(color.b) * weight + (1.0 - weight) * color.b;\n\n    return color;\n}\n\nvec4 applyGamma(
